import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => (
  <div style={{ padding: '20px', background: 'black', color: '#39ff14' }}>
    <h1 style={{ color: '#ffff00' }}>Bienvenue dans notre boutique cyberpunk !</h1>
    <p>Explorez notre catalogue de produits exclusifs !</p>
    <Link
      to="/products"
      style={{
        padding: '10px 20px',
        backgroundColor: '#a020f0',
        color: '#fff',
        textDecoration: 'none',
        borderRadius: '5px',
      }}
    >
      Voir le catalogue
    </Link>
  </div>
);

export default Home;
